import React, { Component } from 'react';
import './App.css';
import Login from './components/Login';
import User from './components/User';

class App extends Component {
  constructor(props){
    super(props);

  }
  render() {
    return (
      <>
      <Login />
      <User />
      </>
    )
  }
}

export default App;
